import React, {Fragment} from 'react';
import Headers from './headers'
import Row from './row'
console.log('Board')

function Board({rows, cols}){
console.log(`printing board with ${rows} rows and ${cols} columns`)
let content = []
    for (let r = 1; r <= rows; r++){

        content.push(<tr><Row row={r} cols={cols}/></tr>)
    }
    return <table>
        <Headers cols="cols"></Headers>
            {content}
        </table>
}

export default Board
